import React, { useEffect, userState } from "react";

export default function Income() {
  const getIncome = () => {
    const url = "http://localhost:8000/income";

    fetch(url)
      .then((response) => response.json)
      .then((data) => console.log(data));
  };

  useEffect(getIncome, []);

  const getRows = () => {};
  return (
    <table className="table">
      <thead>
        <tr>
          <th>ID</th>
          <th>Concept</th>
          <th>Amount</th>
          <th>Date</th>
          <th>Category</th>
        </tr>
      </thead>
      <tbody>{getRows()}</tbody>
    </table>
  );
}
